https://cran.r-project.org/package=PEtes.description:
Two-sample power-enhanced mean tests, covariance tests, and simultaneous tests on mean vectors and covariance matrices for high-dimensional data. Methods of these PE tests are presented in
Yu, Li, and Xue (2022) <doi:10.1080/01621459.2022.2126781>;
Yu, Li, Xue, and Li (2022) <doi:10.1080/01621459.2022.2061354>.

https://cran.r-project.org/package=TreeT.description:
Efficient implementations of functions for the creation,
modification and analysis of phylogenetic trees.
Applications include:
generation of trees with specified shapes;
tree rearrangement;
analysis of tree shape;
rooting of trees and extraction of subtrees;
calculation and depiction of split support;
plotting the position of rogue taxa (Klopfstein & Spasojevic 2019)
<doi:10.1371/journal.pone.0212942>;
calculation of ancestor-descendant relationships,
of 'stemwardness' (Asher & Smith, 2022) <doi:10.1093/sysbio/syab072>,
and of tree balance (Mir et al. 2013, Lemant et al. 2022)
<doi:10.1016/j.mbs.2012.10.005>, <doi:10.1093/sysbio/syac027>;
artificial extinction (Asher & Smith, 2022) <doi:10.1093/sysbio/syab072>;
import and export of trees from Newick, Nexus (Maddison et al. 1997)
<doi:10.1093/sysbio/46.4.590>,
and TNT <https://www.lillo.org.ar/phylogeny/tnt/> formats;
and analysis of splits and cladistic information.

https://cran.r-project.org/package=power.description:
Functions to
calculate power and sample size for testing
(1) mediation effects;
(2) the slope in a simple linear regression;
(3) odds ratio in a simple logistic regression;
(4) mean change for longitudinal study with 2 time points;
(5) interaction effect in 2-way ANOVA; and
(6) the slope in a simple Poisson regression.
